  input: TEXT,F3XA,,"In response to the Commission's recent request for additional
    information concerning the full identification of contributors, please note the
    Committees follows the 'best efforts' guidelines in request information when contributions
    are solicited, making follow-up requests notifying the contributors that federal
    law requires the information to be reported, and disclosing any information received
    as is done in this amendment. Please note that a contributor's employer and occupation
    is not required for earmarked contributions that do not excess $200.  Disbursements
    made for printing, direct mail and media production itemized on Schedule B, Line
    21b, are operating expenditures of the Committee.  Any such expenditures that
    are allocable to a federal candidate are reported as an in-kind contribution or
    independent expenditure."
